import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';

class Trash {
  int id;
  String name;
  String description;
  String userId;
  String imageStr;

  Trash(this.id, this.name, this.description, this.userId, this.imageStr);

  Card buildCard() {
    return Card(
      child: Column(
        children: [
          Image(image: Image.memory(base64Decode(imageStr)).image),
          SizedBox(
              //width: screenSize.width / 1.2,
              //height: screenSize.height / 1.7 - screenSize.height / 2.2,
              child: Column(
            mainAxisAlignment: MainAxisAlignment.spaceEvenly,
            children: <Widget>[
              Text(name),
              Text(description),
            ],
          ))
        ],
      ),
    );
  }

  static List<Trash> fromJson(Map<String, dynamic> json) {
    List<Trash> result = List.empty();
    for (var el in json['result']) {
      log(el.toString());
      var a = el['id'];
      var b = el['name'];
      var c = el['description'];
      var d = el['userId'];
      // final base64Decoder = base64.decoder;
      // const base64Bytes = 'RGFydCBpcyBvcGVuIHNvdXJjZQ==';
      // final decodedBytes = base64Decoder.convert(base64Bytes);
      // var blankBytes =
      //     ""
      //     //"TWFuIGlzIGRpc3Rpbmd1aXNoZWQsIG5vdCBvbmx5IGJ5IGhpcyByZWFzb2"
      //    // ""
      // ;
      // var e = Base64Decoder().convert(blankBytes);
      var f = el['image'];
      f = "";
      result.add(Trash(a, b, c, d, f));
    }
    return result;
  }
}
